cars.description:
NAVIGATION via Apple Carplay & Android AUTO, Fabriksgaranti till mars 2026/10000mil, Räckvidd enligt WLTP upp till 350km, Bi Color Black; Däckreparationssats;
6 st högtalare; Alcantara klädsel, Jet Black; Aluminium sportpedaler; Automatisk avbländbar
innerbackspegel; Dekorlist exteriört, Jet Black; Mittkonsol med armstöd Inkl. USB-port
& mugghållare fram; Svart kontrasttak; Ultimate dekor i instrumentpanel, uppvärmda elektriskt infällbara & justerbara; Ytterbackspeglar, uppvärmda elektriskt justerbara &
manuellt infällbara;
Interiör & Exteriör
Chassi & Bromsar ABS bromsar (16tum skivor fram + 15tum skivor bak); Valbart Sportmode;
Adaptiv farthållare; Aktiv filhållningsassistans; Autobroms och varningssensor med fotgängar- &
cyklistskydd; Bältespåminnare bak; Bältespåminnare fram; Elektrisk parkeringsbroms; ISOFIX-fästen
för barnstolar på ytterplatserna bak; Kollisionsvarning fram, all hastighet; Krockkuddar fram, sidokrockkuddar och krockgardiner; LED blinkers fram&bak; LED Dimljus; LED DRL (Varselljus); LED
Lampor bak; LED Strålkastare; Nyckelfritt Open & Start system; Trafikskyltsavläsning;
Tröttshetsvarnare (Driver Attention Warning);
Säkerhet
Apple CarPlay & Android Auto; DAB, DAB+ & DMB audio module; Multimedia Pro: 10tum pekskärm &
12tum digital-insturmentpanel Opel Pure Panel; Opel Connect, Nöd och haverisamtal;
Media
Förarassitans Backkamera 180 °; Dödavinkelnvarnare; Parkeringsradar fram & bak; Regnsensor;
Säten Baksäte fällbart 60:40; Uppvärmda framsäten;
Klimat Elektronisk klimatanläggning; Uppvärmd ratt;
Fönster & Dörrar Elmanövrerade fönsterhissar fram och bak; Mörktonadebakrutor;
